import React, { Component } from 'react';
import './App.css';
import Joke from './components/Joke';

const App = () => {
  const nums = [1,2,3,4,5,6,7,8];
  const double = nums.map(num => {
    return num * 2;
  })
  console.log(double)
  return (
    <div>
      <Joke question="Hello" punchLine="World"/>
      <Joke punchLine="Yeye"/>
      <Joke question="How's it hanging" punchLine="Good"/>
    </div>
  );
}
export default App;
